using System;
using System.Collections.Generic;
using System.Linq;
using System.Net.Http;
using System.Web;
using System.Threading.Tasks;
using Microsoft.Bot.Schema;
using Microsoft.Bot.Schema.Teams;
using Newtonsoft.Json;

using ADOS2Teams.ADOSSearch.Model;
using System.Text;
using AdaptiveCards;
using Microsoft.Extensions.Configuration;

namespace ADOS2Teams.ADOSSearch
{
    /// <summary>
    /// Azure DevOps Server Search handler
    /// </summary>
    public class ADOSSearchHandler : ISearchHandler
    {
        public HttpClient Client { get; }

        public ADOSSearchHandler(HttpClient client)
        {
            Client = client;
        }

        public async Task<MessagingExtensionResult> GetSearchResultAsync(string query)
        {
            MessagingExtensionResult composeExtensionresult = new MessagingExtensionResult
            {
                Type = "result",
                AttachmentLayout = "list",
                Attachments = new List<MessagingExtensionAttachment>()
            };

            IList<WorkItemResult> wiResults = new List<WorkItemResult>();

            ADOSSearchResult queryResult = await this.InvokeADOSApiAsync(query).ConfigureAwait(false);
            wiResults = queryResult.Results;

            foreach (WorkItemResult res in wiResults)
            {

                var attach = CreateCardAsAttachment(res);
                composeExtensionresult.Attachments.Add(attach);
            }

            return composeExtensionresult;
        }

        private MessagingExtensionAttachment CreateCardAsAttachment(WorkItemResult wi)
        {
            AdaptiveCard card = new AdaptiveCard();
            ThumbnailCard preview = new ThumbnailCard();
            if (wi != null)
            {
                //Getting 'url' based on wi type
                string imageUrl = GetIcon(wi.Fields["system.workitemtype"]);

                //Setting up preview
                preview.Title = wi.Fields["system.id"] + "   " + wi.Fields["system.title"];
                preview.Images = new List<CardImage> { new CardImage(imageUrl) };

                //Setting up main card
                card.Version = new AdaptiveSchemaVersion(1, 0);

                //Setting up title
                AdaptiveTextBlock title = new AdaptiveTextBlock("[" + wi.Fields["system.id"] + "](" + HttpUtility.HtmlAttributeEncode(Client.BaseAddress + "_workitems/edit/" + wi.Fields["system.id"]) + ")   " + wi.Fields["system.title"]);
                title.Wrap = true;
                title.MaxLines = 2;

                AdaptiveColumnSet cs = new AdaptiveColumnSet();

                //Image
                AdaptiveColumn c1 = new AdaptiveColumn();
                c1.Items.Add(new AdaptiveImage
                {
                    Style = AdaptiveImageStyle.Person,
                    AltText = wi.Fields["system.id"],
                    Url = new Uri(GetIcon(wi.Fields["system.workitemtype"])),
                    Size = AdaptiveImageSize.Small
                });
                c1.Width = "auto";
                cs.Columns.Add(c1);

                //Title
                AdaptiveColumn c2 = new AdaptiveColumn();
                c2.Items.Add(title);
                c2.Width = "stretch";
                cs.Columns.Add(c2);

                card.Body.Add(cs);

                //FactSet
                AdaptiveFactSet fs = new AdaptiveFactSet
                {
                    Facts = new List<AdaptiveFact>
                    {
                        new AdaptiveFact{
                            Title = "Created Date:",
                            Value = wi.Fields["system.createddate"]
                        },
                        new AdaptiveFact{
                            Title = "Assigned To:",
                            Value = wi.Fields["system.assignedto"]
                        },
                        new AdaptiveFact{
                            Title = "State:",
                            Value = wi.Fields["system.state"]
                        }
                    }
                };
                card.Body.Add(fs);

            }

            return card.ToAttachment().ToMessagingExtensionAttachment(preview.ToAttachment());
        }

        private async Task<ADOSSearchResult> InvokeADOSApiAsync(string query)
        {
            HttpContent searchQuery = new StringContent("{\"searchText\": \"" + query + "\", \"$top\": 5}", Encoding.UTF8, "application/json");

            HttpResponseMessage resp = await Client.PostAsync("_apis/search/workitemsearchresults?api-version=5.0-preview.1", searchQuery);
            resp.EnsureSuccessStatusCode();
            string respBody = await resp.Content.ReadAsStringAsync().ConfigureAwait(false);
            return JsonConvert.DeserializeObject<ADOSSearchResult>(respBody);
        }

        private string GetIcon(string wiType)
        {
            string imageUrl;
            string res;

            switch (wiType)
            {
                case "Feature":
                    imageUrl = $"{Client.BaseAddress.AbsoluteUri}" + "_apis/wit/workItemIcons/icon_trophy?color=7000A4";
                    res = @"data:image/png;base64,";
                    break;
                case "Requirement":
                    imageUrl = $"{Client.BaseAddress.AbsoluteUri}" + "_apis/wit/workItemIcons/icon_book?color=009ccc";
                    res = @"data:image/png;base64,";
                    break;
                case "Change Request":
                    imageUrl = $"{Client.BaseAddress.AbsoluteUri}" + "_apis/wit/workItemIcons/icon_flame?color=ff9d00";
                    res = @"data:image/png;base64,";
                    break;
                case "Bug":
                    imageUrl = $"{Client.BaseAddress.AbsoluteUri}" + "_apis/wit/workItemIcons/icon_insect?color=cc293d";
                    res = @"data:image/png;base64,";
                    break;
                case "Epic":
                    imageUrl = $"{Client.BaseAddress.AbsoluteUri}" + "_apis/wit/workItemIcons/icon_crown?color=ff7b00";
                    res = @"data:image/png;base64,";
                    break;
                default:
                    imageUrl = $"{Client.BaseAddress.AbsoluteUri}" + "_apis/wit/workItemIcons/icon_clipboard?color=ff7b00";
                    res = @"data:image/png;base64,";
                    break;
            }

            return res;
        }
    }
}
